import React from 'react';
import { Button, Card, List, Comment } from 'antd';
import { StarOutlined, EllipsisOutlined, InstagramOutlined, MessageOutlined } from '@ant-design/icons';

const ProductionCard = () => {
  return (
    <Card 
      style={{ width: 300 }} 
      actions={[
        <StarOutlined />,
        <InstagramOutlined />,
        <MessageOutlined />,
        <EllipsisOutlined />,
    ]}>
      제품
    </Card>
  );
};

export default ProductionCard;
